commit_message:
bundle console assets into server (close #516, close #521, close #2130) (#2192) This PR builds console static assets into the server docker image at `/srv/console-assets`. When env var `HASURA_GRAPHQL_CONSOLE_ASSETS_DIR=/srv/console-assets` or flag `--console-assets-dir=/srv/console-assets` is set on the server, the files in this directory are served at `/console/assets/*`.

The console html template will have a variable called `cdnAssets: false` when this flag is set and it loads assets from server itself instead of CDN.

The assets are moved to a new bucket with a new naming scheme:

```
graphql-engine-cdn.hasura.io/console/assets/
   /common/{}
   /versioned/<version/{}
   /channel/<channel>/<version>/{}
```

Console served by CLI will still load assets from CDN - will fix that in the next release.

add "*" for insert and delete columns when creating and modifying trigger (close #1629) (#1673) This PR adds "*" as columns for insert and delete so that there are no column dependencies on event triggers and users can drop/modify columns whenever they want.

```
{
	"type": "bulk",
	"args": [{
		"type": "create_event_trigger",
		"args": {
			"name": "test",
			"table": {
				"name": "user",
				"schema": "public"
			},
			"webhook": "http://httpbin.org/post",
			"insert": {
				"columns": "*"
			},
                        "update": {
                               "columns": ["col1", "col2"] 
                       },
                       "delete": {
                               "columns": "*"
                       }
			"headers": []
		}
	}]
}
```

change table  and foreign-key naming conventions in json2graphql (#485) Foreign keys will now be detected if a column name is `<table_name>_id`.

Earlier, foreign keys would be detected when column name was `<table_name - s>_id`. This was a problem because it placed restrictions on table names. Such restrictions were limiting us from importing complicated JSON databases.

Here are the examples of JSON sampel data for a user, post and comment schema as per new and old conventions:

Old convention:

```
{
    posts: [
        { id: 1, title: "Lorem Ipsum", views: 254, user_id: 123 },
        { id: 2, title: "Sic Dolor amet", views: 65, user_id: 456 },
    ],
    users: [
        { id: 123, name: "John Doe" },
        { id: 456, name: "Jane Doe" }
    ],
    comments: [
        { id: 987, post_id: 1, body: "Consectetur adipiscing elit" },
        { id: 995, post_id: 1, body: "Nam molestie pellentesque dui" }
    ]
}
```

New convention:

```
{
    post: [
        { id: 1, title: "Lorem Ipsum", views: 254, user_id: 123 },
        { id: 2, title: "Sic Dolor amet", views: 65, user_id: 456 },
    ],
    user: [
        { id: 123, name: "John Doe" },
        { id: 456, name: "Jane Doe" }
    ],
    comment: [
        { id: 987, post_id: 1, body: "Consectetur adipiscing elit" },
        { id: 995, post_id: 1, body: "Nam molestie pellentesque dui" }
    ]
};
``` 

@FrediBach I am not sure how this would affect [Blowson](https://github.com/FrediBach/json-data-extender). Can you provide some input?
